nspiring one that drives us every single day.\\n\\nBecome a Game-Changer\\nSo what do you say? Are you ready to become an ANGELian game-changer on this journey? Let\'s team up and transform the future of well-being through hybrid intelligence!\\n"}],"B":[{"A?":"A","A":{"font-family":{"B":"YAFdJvgJ5TU,0"},"font-size":{"B":"29.0955"}}},{"A?":"B","A":1},{"A?":"A","A":{"color":{"B":"#ffffff"}}},{"A?":"B","A":18},{"A?":"A","A":{"font-size":{"A":"29.0955","B":"13.6852"}}},{"A?":"B","A":186},{"A?":"A","A":{"font-size":{"A":"13.6852","B":"18.6667"}}},{"A?":"B","A":15},{"A?":"A","A":{"font-size":{"A":"18.6667","B":"13.6852"}}},{"A?":"B","A":184},{"A?":"A","A":{"font-size":{"A":"13.6852","B":"18.6667"}}},{"A?":"B","A":33},{"A?":"A","A":{"font-size":{"A":"18.6667","B":"13.6852"}}},{"A?":"B","A":455},{"A?":"A","A":{"font-size":{"A":"13.6852","B":"18.6667"}}},{"A?":"B","A":21},{"A?":"A","A":{"font-size":{"A":"18.6667","B":"13.6852"}}},{"A?":"B","A":232},{"A?":"A","A":{"font-size":{"A":"13.6852","B":"18.6667"}}},{"A?":"B","A":18},{"A?":"A","A":{"font-size":{"A":"18.6667","B":"13.6852"}}},{"A?":"B","A":231},{"A?":"A","A":{"font-size":{"A":"13.6852","B":"18.6667"}}},{"A?":"B","A":20},{"A?":"A","A":{"font-size":{"A":"18.6667","B":"13.6852"}}},{"A?":"B","A":220},{"A?":"A","A":{"font-size":{"A":"13.6852","B":"18.6667"}}},{"A?":"B","A":22},{"A?":"A","A":{"font-size":{"A":"18.6667","B":"13.6852"}}},{"A?":"B","A":169},{"A?":"A","A":{"color":{"A":"#ffffff"},"font-family":{"A":"YAFdJvgJ5TU,0"},"font-size":{"A":"13.6852"}}}]},"b":{"A":[]},"d":"A","e":643.9910245197883,"f":675.6372742382813,"g":false,"h":"A"},{"A?":"K","A":28.833934060474533,"B":283.56026660498713,"D":84.03669917685193,"C":28.194769123535156,"E":0.0,"F":0.0,"Q":false,"S":false,"P":[],"5":{},"T":{},"W":{},"a":{"A":[{"A?":"A","A":"Home\\n"}],"B":[{"A?":"A","A":{"color":{"B":"#ffffff"},"text-align":{"B":"center"},"font-size":{"B":"24.0001"},"font-family":{"B":"YAFdJvSyp_k,2"}}},{"A?":"B","A":4},{"A?":"A","A":{"text-transform":{
